import React from 'react';
import Add from './Add';
import Sub from './Sub';
import Div from './Div';
import Mult from './Mult';



const App = () => {
    return (
        <>
            <h1>The sum  of these two numbers is , <span> {Add}</span></h1>
            <h1>The sum  of these two numbers is , <span> {Sub}</span></h1>
            <h1>The sum  of these two numbers is , <span> {Div}</span></h1>
            <h1>The sum  of these two numbers is , <span> {Mult}</span></h1>
        </>
    )
}

export default App;
